define("D_CAT_ASSEMLY", "INSERT INTO `drug_categories` (`id`, `uuid`, `DCID`, `CategoryName`, `CategoryDescription`, `created_at`, `updated_at`) VALUES
(1, '@2y@10@AeaNENZ.ZcVCY.w1NxUo7u.6hVQpP9aXVdPELggTO5p79oRnpNIwq', '@2y@10@J7gVxXrZbNK6mpG0jzskauz6vafnN9Or39FzGIBdVGuN4s0OjWhKS', 'Stimulants', '<h2 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 30px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Stimulants</h2><p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-size: 15px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; line-height: 1.5; color: rgb(109, 109, 109);\">Stimulants speed up the body’s nervous system and create a feeling of energy. They are also called “uppers” because of their ability to make you feel very awake. Stimulants have the opposite effect of depressants. When the effects of a stimulant wear off, the user is typically left with feelings of sickness and a loss of energy. Constant use of such drugs, when not used as prescribed, can have very negative effects on the user. In&nbsp;order&nbsp;to prevent extreme negative side effects of these drugs and the impact they have on life, drug treatment centers are often recommended.</p><h3 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 24px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Types of drugs include:</h3><ol style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 30px; padding: 0px; font-size: 15px; direction: ltr; line-height: 1.6; list-style-position: outside; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif;\"><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Cocaine</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Methamphetamines</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Amphetamines</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Ritalin</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Cylert</li></ol>', '2008-01-06 08:16:39', NULL),
(2, '@2y@10@LStdZh71yEy9KiAKEWSwquUCKLEcFJ3yhG1X6NqSYASgfUDj64SRm', '@2y@10@aieVQIZGoR1fYoEbuQktfOS.UhjYbEbvKVi3hoDUZ8I2e6Ftt6SWu', 'Inhalants', '<h2 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 30px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Inhalants</h2><p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-size: 15px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; line-height: 1.5; color: rgb(109, 109, 109);\">Inhalants are sniffed or huffed and give the user immediate results. Unfortunately, these immediate results can also result in sudden mental damage. When inhalants are taken, the body becomes deprived of oxygen, causing a rapid heart beat. Other effects include liver, lung and kidney problems, affected sense of smell, difficulty walking and confusion.</p><h3 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 24px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Types of drugs include:</h3><ol style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 30px; padding: 0px; font-size: 15px; direction: ltr; line-height: 1.6; list-style-position: outside; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif;\"><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Glues</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Paint thinner</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Gasoline</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Laughing gas</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Aerosol sprays</li></ol>', '2008-01-06 08:17:08', NULL),
(3, '@2y@10@tSvRncKwy7UNFYbpjBHJ6uyZ.XQwqMcoNO8qEGCCAdwjKYO3HQOua', '@2y@10@BvTQsx.FxmBepO1n7lpsD.2W/xaTcSNfjwx0zZbzXpIkI26r4U40a', 'Cannabinoids', '<h2 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 30px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Cannabinoids</h2><p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-size: 15px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; line-height: 1.5; color: rgb(109, 109, 109);\">These drugs result in feelings of euphoria, cause confusion and memory problems, anxiety, a higher heart rate, as well as staggering and poor reaction time.</p><h3 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 24px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Types of drugs include:</h3><ol style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 30px; padding: 0px; font-size: 15px; direction: ltr; line-height: 1.6; list-style-position: outside; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif;\"><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Hashish</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Marijuana</li><li></li></ol>', '2008-01-06 08:17:21', NULL),
(4, '@2y@10@Sb0DZz8PeUaQHhSHOLCqbuH1zBxOER.JCsVREfz0DLLx7RtFg8VK.', '@2y@10@241TpUtdx0mHKIfvctFQeubjzxqLQg7YCXUev4CT3972WyfJ.PEMu', 'Depressants', '<h2 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 30px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Depressants</h2><p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-size: 15px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; line-height: 1.5; color: rgb(109, 109, 109);\">Depressants slow down activity in the central nervous system of your body. These drugs are also called “downers” because they slow the body down and seem to give feelings of relaxation. Depressants are available as prescription drugs to relieve stress and anger, although drowsiness is often a side effect. The “relaxation” felt from these drugs is not a healthy feeling for the body to experience, to stop abuse of this drug, drug treatment is suggested.</p><h3 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 24px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Types of drugs:</h3><ol style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 30px; padding: 0px; font-size: 15px; direction: ltr; line-height: 1.6; list-style-position: outside; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif;\"><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Barbiturates</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Benzodiazepines</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Flunitrazepam</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">GHB (Gamma-hydroxybutyrate)</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Methaqualone</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Alcohol</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Tranquillisers</li></ol>', '2008-01-06 08:17:33', NULL),
(5, '@2y@10@8/WacJRctj7xiYXv42tA9eIo5uU2JRithgxQcYGndHlY44QIZrvXa', '@2y@10@DghJbDFTbGuClpG1fmlvuO10FYgN1X3lEpbrfX2WKYK3SrZUpsjxK', 'Opioids & Morphine Derivatives', '<h2 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 30px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Opioids &amp; Morphine Derivatives</h2><p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-size: 15px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; line-height: 1.5; color: rgb(109, 109, 109);\">Opioids and morphine derivatives can cause drowsiness, confusion, nausea, feelings of euphoria, respiratory complications and relieve pain.</p><h3 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 24px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Types of drugs include:</h3><ol style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 30px; padding: 0px; font-size: 15px; direction: ltr; line-height: 1.6; list-style-position: outside; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif;\"><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Codeine</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Fentanyl and fentanyl analogs</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Heroin</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Morphine</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Opium</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Oxycodone HCL</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Hydrocodone bitartrate, acetaminophen</li></ol>', '2008-01-06 08:18:10', NULL),
(6, '@2y@10@n60A8bApjBVwHZu66ACy2Ox7T.5Sx/EelQdGB2mfojZdOCK5DD7tq', '@2y@10@VmkNcWCYW3IdDDCa4Z6TiupBzCSIK7rM315ORj4pSWw7zr/W9Gjcy', 'Anabolic Steroids', '<h2 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 30px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Anabolic Steroids</h2><p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-size: 15px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; line-height: 1.5; color: rgb(109, 109, 109);\">Steroids are taken to improve physical performance as well as to enlarge muscles and increase strength. Negative effects of steroids include baldness, cysts, oily hair and skin, acne, heart attack, stroke and change in voice. Hostility is also a frequent side effect of anabolic steroids.</p><h3 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 24px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Types of drugs include:</h3><ol style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 30px; padding: 0px; font-size: 15px; direction: ltr; line-height: 1.6; list-style-position: outside; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif;\"><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Anadrol</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Oxandrin</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Durabolin</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Stanozol</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Dianabol</li></ol>', '2008-01-06 08:18:28', NULL),
(7, '@2y@10@y4uTtocDnJWmLp.0swD7b.0/XjKRyFZdGrwz7G3nX0VqD3og55v.u', '@2y@10@T9A.TbmgrEo6RKrkT1nkL.UUL.AZ/pf8.7Zew/E3rhNUvwUbX4vmC', 'Hallucinogens', '<h2 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 30px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Hallucinogens</h2><p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-size: 15px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; line-height: 1.5; color: rgb(109, 109, 109);\">When taking hallucinogens, switching emotions is frequent. These drugs change the mind and cause the appearance of things that are not really there. Hallucinogens affect the body’s self-control, such as speech and movement, and often bring about hostility. Other negative side effects of these drugs include heart failure, increased heart rate, higher blood pressure and changes in the body’s hormones.</p><h3 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 24px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Types of drugs include:</h3><ol style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 30px; padding: 0px; font-size: 15px; direction: ltr; line-height: 1.6; list-style-position: outside; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif;\"><li style=\"margin: 0px; padding: 0px; direction: ltr;\">LSD (lysergic acid diethylamide)</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Mescaline</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Psilocybin</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Magic Mushrooms</li></ol>', '2008-01-06 08:18:59', NULL),
(8, '@2y@10@t5mphE6Er0kM6oxH7TT0/uIbvY7uaP2L7cbG74e8P1jaqKzAN2sDq', '@2y@10@ptikhufkCTPNCNX1al7cr.TpPzmX4lggt7FukzwbOPDDo6MxHCyqW', 'Prescription Drugs', '<h2 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 30px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Prescription Drugs</h2><p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-size: 15px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; line-height: 1.5; color: rgb(109, 109, 109);\">Prescription drugs can be very helpful drugs when used properly and when under the guidance of a qualified physician. These drugs can be used as aids in surgery, to treat medical conditions and while controlling various symptoms. Misuse and abuse of prescription drugs however can be very dangerous.</p><h3 style=\"overflow-wrap: break-word; margin: 20px 0px 10px; padding: 0px; font-size: 24px; direction: ltr; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif; font-weight: 500; color: rgb(51, 51, 51); text-rendering: optimizelegibility; line-height: 1.1;\">Types of drugs include:</h3><ol style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 30px; padding: 0px; font-size: 15px; direction: ltr; line-height: 1.6; list-style-position: outside; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, Verdana, sans-serif;\"><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Opiods: Codeine, Oxycodone, Morphine</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Central nervous system depressants: barbiturates, benzodiazepines</li><li style=\"margin: 0px; padding: 0px; direction: ltr;\">Stimulants: dextroamphetamine, methylphenidate</li></ol>', '2008-01-06 08:19:21', NULL),
(9, '@2y@10@lQcRdANSozuoNjPYJTFXbeHPd3e.9p3R3BRk87iwnw8XOIm4EkfHC', '@2y@10@b.4SYdRyND6KpCl.yNwmVu08LnanZ/C9x9eR6n4u/kiLhsEM8ZmEK', 'Central Nervous System (CNS) Depressants', '<h3 style=\"box-sizing: inherit; margin: 20px 0px 40px; color: rgb(0, 40, 86); font-weight: 500; font-size: 32px; line-height: 1.4; font-family: &quot;Gotham SSm A&quot;, &quot;Gotham SSm B&quot;, Gotham, &quot;Proxima Nova&quot;, Montserrat, Lato, Avenir, &quot;Helvetica Neue&quot;, Helvetica, -apple-system, BlinkMacSystemFont, sans-serif;\">Central Nervous System (CNS) Depressants</h3><p style=\"box-sizing: inherit; font-size: 18px; line-height: 2; margin-right: 0px; margin-bottom: 36px; margin-left: 0px; color: rgb(0, 14, 30); font-family: &quot;Gotham SSm A&quot;, &quot;Gotham SSm B&quot;, Gotham, &quot;Proxima Nova&quot;, Montserrat, Lato, Avenir, &quot;Helvetica Neue&quot;, Helvetica, -apple-system, BlinkMacSystemFont, sans-serif;\">CNS depressants slow down the operations of the brain and the body. Examples of CNS depressants include alcohol, barbiturates, anti-anxiety tranquilizers (e.g., Valium, Librium, Xanax, Prozac, and Thorazine), GHB (gamma hydroxybutyrate), Rohypnol, and many other anti-depressants (e.g., Zoloft, Paxil).</p>', '2008-01-06 08:19:44', NULL),
(10, '@2y@10@GvIvj7k4zklPcoZPSrmFTeqGF85JhJy.tR56KJt94PYg.ccwp4HPu', '@2y@10@QzUUCyqj6IX5qEwEeDxyfe.PmpWNntAOscFJrc44SP8i6eJMjrygu', 'CNS Stimulants', '<h3 style=\"box-sizing: inherit; margin: 20px 0px 40px; color: rgb(0, 40, 86); font-weight: 500; font-size: 32px; line-height: 1.4; font-family: &quot;Gotham SSm A&quot;, &quot;Gotham SSm B&quot;, Gotham, &quot;Proxima Nova&quot;, Montserrat, Lato, Avenir, &quot;Helvetica Neue&quot;, Helvetica, -apple-system, BlinkMacSystemFont, sans-serif;\">CNS Stimulants</h3><p style=\"box-sizing: inherit; font-size: 18px; line-height: 2; margin-right: 0px; margin-bottom: 36px; margin-left: 0px; color: rgb(0, 14, 30); font-family: &quot;Gotham SSm A&quot;, &quot;Gotham SSm B&quot;, Gotham, &quot;Proxima Nova&quot;, Montserrat, Lato, Avenir, &quot;Helvetica Neue&quot;, Helvetica, -apple-system, BlinkMacSystemFont, sans-serif;\">CNS stimulants accelerate the heart rate and elevate the blood pressure and \"speed-up,\" or over-stimulate, the body. Examples of CNS stimulants include cocaine, \"crack\" cocaine, amphetamines, and methamphetamine (\"crank\").</p><div><br></div>', '2008-01-06 08:20:26', NULL),
(11, '@2y@10@oC/ePjBAMFYEzjcZPFYm..xQ53aDUDdYTyquiXdLjy5HdTtSy5FIO', '@2y@10@uYhb8WuGNesF8dRpB4fI2ezdCtt8wySfyl6G4hzVPFvoQUMsqP3Vy', 'Dissociative Anesthetics', '<h3 style=\"box-sizing: inherit; margin: 20px 0px 40px; color: rgb(0, 40, 86); font-weight: 500; font-size: 32px; line-height: 1.4; font-family: &quot;Gotham SSm A&quot;, &quot;Gotham SSm B&quot;, Gotham, &quot;Proxima Nova&quot;, Montserrat, Lato, Avenir, &quot;Helvetica Neue&quot;, Helvetica, -apple-system, BlinkMacSystemFont, sans-serif;\">Dissociative Anesthetics</h3><p style=\"box-sizing: inherit; font-size: 18px; line-height: 2; margin-right: 0px; margin-bottom: 36px; margin-left: 0px; color: rgb(0, 14, 30); font-family: &quot;Gotham SSm A&quot;, &quot;Gotham SSm B&quot;, Gotham, &quot;Proxima Nova&quot;, Montserrat, Lato, Avenir, &quot;Helvetica Neue&quot;, Helvetica, -apple-system, BlinkMacSystemFont, sans-serif;\">Dissociative anesthetics&nbsp;include drugs that inhibit pain by cutting off or dissociating the brain\'s perception of the pain. PCP, its analogs, and dextromethoraphan are examples of dissociative anesthetics.</p>', '2008-01-06 08:20:43', NULL),
(12, '@2y@10@bwoMuHjPfpIKqJ.KXw.uzOFh8RpccgKTdnbCY6Kn56OoZaUOLZitC', '@2y@10@qKWdCObdW9epjmfd4dBpGulC7cCCaoRzzRIpz5Pfb/zcLE5UovIxS', 'Narcotic Analgesics', '<h3 style=\"box-sizing: inherit; margin: 20px 0px 40px; color: rgb(0, 40, 86); font-weight: 500; font-size: 32px; line-height: 1.4; font-family: &quot;Gotham SSm A&quot;, &quot;Gotham SSm B&quot;, Gotham, &quot;Proxima Nova&quot;, Montserrat, Lato, Avenir, &quot;Helvetica Neue&quot;, Helvetica, -apple-system, BlinkMacSystemFont, sans-serif;\">Narcotic Analgesics</h3><p style=\"box-sizing: inherit; font-size: 18px; line-height: 2; margin-right: 0px; margin-bottom: 36px; margin-left: 0px; color: rgb(0, 14, 30); font-family: &quot;Gotham SSm A&quot;, &quot;Gotham SSm B&quot;, Gotham, &quot;Proxima Nova&quot;, Montserrat, Lato, Avenir, &quot;Helvetica Neue&quot;, Helvetica, -apple-system, BlinkMacSystemFont, sans-serif;\">Narcotic analgesics relieve pain, induce euphoria, and create mood changes in the user. Examples of narcotic analgesics include opium, codeine, heroin, demerol, darvon, morphine, methadone, Vicodin, and oxycontin.</p><div><br></div>', '2008-01-06 08:21:10', NULL),
